import * as React from "react"
import Svg, { G, Circle, Path, Defs } from "react-native-svg"
/* SVGR has dropped some elements not supported by react-native-svg: filter */
const SendSvg = (props) => (
  <Svg
    xmlns="http://www.w3.org/2000/svg"
    width={78}
    height={98}
    fill="none"
    {...props}
  >
    <G filter="url(#a)">
      <Circle cx={49} cy={45} r={45} fill="#fff" />
    </G>
    <Path
      stroke="#0076B9"
      strokeWidth={1.9}
      d="M79 44.5 37 17v27.5m42 0L37 72V44.5m42 0H37"
    />
    <Path
      stroke="#000"
      strokeOpacity={0.2}
      strokeWidth={1.9}
      d="M79 44.5 37 17v27.5m42 0L37 72V44.5m42 0H37"
    />
    <Defs></Defs>
  </Svg>
)
export default SendSvg
